    public static void genCos900() {
        for (int i = 0; i < 900; ++i) {
            final double g = Math.cos(i / 10.0f * 3.141592653589793 / 180.0);
            LMSLog.d("LMS_CosTable", "cos " + i / 10.0f + ":" + g + ",");
        }
    }
    
    public static void genCos360() {
        for (int i = 0; i < 360; ++i) {
            final double g = Math.cos(i / 4.0f * 3.141592653589793 / 180.0);
            LMSLog.d("LMS_CosTable", "cos " + i / 4.0f + ":" + g + ",");
        }
    }
    
    public static void genCos180() {
        for (int i = 0; i < 180; ++i) {
            final double g = Math.cos(i / 2.0f * 3.141592653589793 / 180.0);
            LMSLog.d("LMS_CosTable", "cos " + i / 2.0f + ":" + g + ",");
        }
    }
    
    public static void genCos90() {
        for (int i = 0; i < 90; ++i) {
            final double g = Math.cos(i * 3.141592653589793 / 180.0);
            LMSLog.d("LMS_CosTable", "cos " + (float)i + ":" + g + ",");
        }
    }
    
    public static void genOneLine(final int height, final int pointNum, final float angle) {
        String oneline = "";
        for (int i = 0; i < pointNum; ++i) {
            final int length = (int)(height / Math.sin(i * angle / (pointNum - 1) * 3.141592653589793 / angle));
            oneline = String.valueOf(oneline) + Integer.toHexString(length).toUpperCase();
            oneline = String.valueOf(oneline) + " ";
        }
        LMSLog.d("LMS_CosTable", "oneLine= " + oneline);
    }
